;; **
;;; # Stochastic Neighbour Embedding
;;; implementing the original [Stochastic Neighbour Embedding](http://www.cs.nyu.edu/~roweis/papers/sne_final.pdf) without mixtures and with a Gaussian distribution over neighbours in low-dimensional space (not t-SNE). σ is variance over all other data-points, binary search not yet understood/ implemented.
;; **

;; @@
(ns stochastic-neighbour-embedding
  (:refer-clojure :exclude [* - + == /])
  (:use clojure.core.matrix.operators)
  (:require [gorilla-plot.core :as plot]
            [gg4clj.core :as gg4clj]
            [clojure.math.combinatorics :refer [cartesian-product]]
            [cnc.analytics :as a]
            [incanter.stats :as s]
            [cnc.execute :as exe]
            [clojure.pprint :refer [pprint]]
            [hasch.core :refer [uuid]]
            [boltzmann.matrix :refer [full-matrix]]
            [clojure.java.shell :refer [sh]]
            [cnc.core :refer [state]]
            [cnc.execute :refer [slurp-bytes]]
            [clj-hdf5.core :as hdf5]
            [konserve.protocols :refer [-get-in -bget -exists?]]
            [geschichte.platform :refer [<!?]]
            [boltzmann.core :refer [train-cd sample-gibbs]]
            [boltzmann.theoretical :refer [create-theoretical-rbm]]
            [boltzmann.formulas :as f]
            [boltzmann.protocols :refer [-weights -biases]]
            [boltzmann.visualize :as v]
            [clojure.core.matrix :refer [dot matrix] :as mat]
            [datomic.api :as d]
            [clojure.core.async :refer [chan] :as async]
            [quil.core :as q]))
(def store (get-in @state [:repo :store]))
(def states (apply cartesian-product (repeat 9 [0 1])))
(def conn (a/conn "train current rbms4"))
(defn exp [x] (Math/exp x))
(defn ² [x] (Math/pow x 2))
(def r# (comp range count))
