;; **
;;; ## Import Iris as dataset
;; **

;; @@
(require '[incanter.core :as ic]
         '[incanter.datasets :as ds])
(def iris (ds/get-dataset :iris))
#_(ic/view iris)
(def iris-mat (ic/to-matrix iris))
#_(ic/view iris-mat)
(def data (matrix iris-mat))
(def ys (mapv vec (take (count data) (repeatedly #(s/sample-normal 2 :sd 1e-4)))))
