;; **
;;; ## Formulas
;;; 
;;; Section 1, 1-5.
;; **

;; @@
(def ∑ (partial apply mat/add))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/∑</span>","value":"#'stochastic-neighbour-embedding/∑"}
;; <=

;; @@
(def p 
  (memoize (fn [d i j]
 (let [dvar (mapv s/variance d)]
  (/ (exp (- (/ (² ((d i) j)) 
                (* 6 (dvar i)))))
     (∑ (for [k (r# d) :when (not= k i)]
          (exp (- (/ (² ((d i) k)) 
                     (* 6 (dvar i))))))))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/p</span>","value":"#'stochastic-neighbour-embedding/p"}
;; <=

;; @@
(defn q [yd i j]
  (/ (exp (- (² ((yd i) j))))
     (∑ (for [k (r# yd) :when (not= k i)]
          (exp (- (² ((yd i) k))))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/q</span>","value":"#'stochastic-neighbour-embedding/q"}
;; <=

;; @@
(defn dists [y]
  (vec (for [i (r# y)]
         (vec (for [j (r# y)]
                (s/euclidean-distance (y i) (y j)))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/dists</span>","value":"#'stochastic-neighbour-embedding/dists"}
;; <=

;; @@
(q (dists ys) 1 2)

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.006711409829452413</span>","value":"0.006711409829452413"}
;; <=

;; @@
(defn ∂C [d y yd i]
  (* 2 (∑ (for [j (r# d)]
            (* (- (y i) (y j))
               (+ (p d i j) 
                  (- (q yd i j))
                  (p d j i)
                  (- (q yd j i))))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/∂C</span>","value":"#'stochastic-neighbour-embedding/∂C"}
;; <=

;; @@
(defn norm-update [up]
  (∑ (map #(s/euclidean-distance
             % (mat/zero-vector 2)) up)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/norm-update</span>","value":"#'stochastic-neighbour-embedding/norm-update"}
;; <=

;; @@
(defn random-matrix [rows columns 
                     & {:keys [sd mean] 
                        :or {sd 1 mean 0}}]
  (->> (repeatedly 
         #(s/sample-normal columns 
                           :sd sd :mean mean))
        (take rows)
        matrix))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/random-matrix</span>","value":"#'stochastic-neighbour-embedding/random-matrix"}
;; <=

;; @@
(defn train [init dd rate epochs]
  (let [dc (count dd)
        dr (range dc)]
(reduce (fn [yss r] 
          (let [[[ys oup]] yss
                yd (dists ys)
                up (time (mapv #(∂C dd ys yd %) dr))
                ar (/ (+ 30 rate) (+ (inc r) 30))
                upr (+ (* 0.5 up)
                       (* 0.5 oup)
                       (random-matrix dc
                                      2
                                      :sd (/ 1e-3 (inc r))))
                ys' (- ys (* ar upr))]
            (println "Step:" r "rate: " ar ", update size:" (norm-update upr))
            (conj yss [ys' upr])))
        (list [init (mat/zero-matrix dc 2)])
        (range epochs))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/train</span>","value":"#'stochastic-neighbour-embedding/train"}
;; <=

;; @@
(def trained (train ys (dists data) 1 50))
