;; **
;;; ## Compare p and q
;;; 
;;; The gradient descent optimizes the difference between the softmax distribution p over pair-wise distances in high-dimensional space and the distribution q over pair-wise distances in the low-dimensional (2D) space. Hence one can see how the descent approximates the original distribution. This also depends on the choice of σ.
;; **

;; @@
(plot/list-plot (map #(p (dists data) 6 %) (range (count data))))
