;; **
;;; ## MNIST
;;; Try with three classes 50 data-points each on MNIST.
;; **

;; @@
(require '[boltzmann.mnist :as mnist]
         '[boltzmann.visualize :as visu])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/images</span>","value":"#'stochastic-neighbour-embedding/images"}
;; <=

;; @@
(def images (boltzmann.mnist/read-images "/usr/src/boltzmann/resources/train-images-idx3-ubyte"))
;; @@

;; @@
(def labels (mnist/read-labels "/usr/src/boltzmann/resources/train-labels-idx1-ubyte"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/labels</span>","value":"#'stochastic-neighbour-embedding/labels"}
;; <=

;; @@
(defn filter-class [c]
(apply concat (map-indexed (fn [i l] (if (= l c) 
                                 [(images i)]
                                 [])) labels)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/filter-class</span>","value":"#'stochastic-neighbour-embedding/filter-class"}
;; <=

;; @@
(->> (filter-class 4) 
     (take 100 )
     (map #(partition 28 %))
     (visu/tile 10)
     (visu/render-float-matrix (fn [v] [0 0 v]))
     visu/view)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;JFrame javax.swing.JFrame[frame11,0,24,280x280,layout=java.awt.BorderLayout,title=No title,normal,defaultCloseOperation=HIDE_ON_CLOSE,rootPane=javax.swing.JRootPane[,5,25,270x250,layout=javax.swing.JRootPane$RootLayout,alignmentX=0.0,alignmentY=0.0,border=,flags=16777673,maximumSize=,minimumSize=,preferredSize=],rootPaneCheckingEnabled=true]&gt;</span>","value":"#<JFrame javax.swing.JFrame[frame11,0,24,280x280,layout=java.awt.BorderLayout,title=No title,normal,defaultCloseOperation=HIDE_ON_CLOSE,rootPane=javax.swing.JRootPane[,5,25,270x250,layout=javax.swing.JRootPane$RootLayout,alignmentX=0.0,alignmentY=0.0,border=,flags=16777673,maximumSize=,minimumSize=,preferredSize=],rootPaneCheckingEnabled=true]>"}
;; <=

;; @@
(def threes (take 50 (filter-class 3)))
(def fours (take 50 (filter-class 4)))
(def fives (take 50 (filter-class 5)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/fives</span>","value":"#'stochastic-neighbour-embedding/fives"}
;; <=

;; @@
(def mnist-data (matrix (concat threes fours fives)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;stochastic-neighbour-embedding/mnist-data</span>","value":"#'stochastic-neighbour-embedding/mnist-data"}
;; <=

;; @@
(plot/list-plot (map #(if (= % 125) 0 (p mnist-dist 125 %)) (r# mnist-data)))
